import api from '../../../Re-usable/Api Url/apiURL'
import {webApiURL as webApiUrl} from "../../../../Constants/URLConstants";


export const getAllClinics =async () => {
    try {
        const res = await api.get(webApiUrl.clinics.getAllClinics);

      console.log("all clinics",res.data)

    } catch (e) {

    }
}

export const postClinic =async (clinic) => {

    try {
        const res = await api.post(webApiUrl.clinics.postClinic,clinic);

        console.log("post clinic",res.data)

    } catch (e) {

    }
}
